<p>图由</p>
<ul>
<li>
<p>一个哈希表 (int,Node) nodes -&gt; 记录点的信息</p>
<ul>
<li>其中 Node具有
<ul>
<li>int in -&gt; 记录入度</li>
<li>int out -&gt; 记录出度</li>
<li>int data -&gt; 记录点的数据</li>
<li>ArrayList(Node) -&gt; 记录散发的边涉及的点</li>
<li>ArrayList(Edge） -&gt; 记录散发的边</li>
</ul>
</li>
